import './FooterStyles.css';
import React from "react";
import { FaHome,FaPhoneAlt,FaMailBulk} from "react-icons/fa";


function Footer() {
  return (
    <React.Fragment>
        <div className="container">
            <div className="row">
                <div className="col-md-6">
<div className='mt-5'><FaHome size={20} style={{color:'blue',marginRight:'1.5rem'}}/>West Melbourne,<br/>
        <span className='p-5'>Florida.</span><br/>
        <FaPhoneAlt size={20} style={{color:'blue',margin:'1.5rem'}}/>321-405-4650<br/>
        <FaMailBulk size={20} style={{color:'blue',marginRight:'1.5rem'}}/>vanim2@gmail.com
</div>
                </div>
                <div className="col-md-6">

                </div>
            </div>
        </div>
    </React.Fragment>
  )
}

export default Footer;
